import React from "react";

function SetPlus (props) {
  let setplus
  let setminus
  console.log(props)
  if (props.button===true) {
    setplus=<div>
              <div className="page__status__link">
                <a onClick={props.onClick}>Сменить статус</a>
              </div>
              <div className="page__status__input">
                <input className="page__status__input--redact" onChange={props.onChange} value={props.status} type="text" name="redaction"/>
              </div>
            </div>}
  if (props.button===false) {
    setminus=<div>
              <div className="page__status__link">
                <a onClick={props.onClick}>Сменить статус</a>
              </div>
              <div className="page__status__text">
                {props.status}
              </div>
             </div>}
  console.log(props)
  return (
    <div className="page__status">
      <div className="page__status__header">
        Здравствуйте, Человек №58745874
      </div>
        {setplus}
        {setminus}
    </div>
  )
}

export default SetPlus
